using System;
using System.Collections.Generic;
using System.Linq;
using System.Net;
using System.Net.Http;
using System.Text;
using FluentAssertions;
using NUnit.Framework;

namespace NSExporter.Test
{
    internal class WhenRetrievingDataFromNS
    {
        [Test]
        public void TheVersionInformationShouldBeRetrieved()
        {
            var messageHandler = new Codenizer.HttpClient.Testable.TestableMessageHandler();
            var httpClient = new HttpClient(messageHandler) { BaseAddress = new Uri("http://localhost:5000") };
            
            messageHandler.RespondTo(HttpMethod.Get, "/api/v1/status.json")
                .With(HttpStatusCode.OK)
                .AndContent("application/json",_serverInfo);

            NightscoutVersion.FromJson(
                new NightscoutApi(httpClient)
                    .GetServerInformation().Result)
                .VersionString
                .Should().Be("14.2.6");
        }

        [Test]
        public void TheVersionInformationShouldBeDefaultedWhenAServerIsNotReturningAVersion()
        {
            var messageHandler = new Codenizer.HttpClient.Testable.TestableMessageHandler();
            var httpClient = new HttpClient(messageHandler) { BaseAddress = new Uri("http://localhost:5000") };
            
            messageHandler.RespondTo(HttpMethod.Get, "/api/v1/status.json")
                .With(HttpStatusCode.InternalServerError);

            NightscoutVersion.FromJson(
                    new NightscoutApi(httpClient)
                        .GetServerInformation().Result)
                .VersionString
                .Should().Be("Unavailable");
        }

        [Test]
        public void TheGlucoseDataShouldBeRetrieved()
        {
            var messageHandler = new Codenizer.HttpClient.Testable.TestableMessageHandler();
            var httpClient = new HttpClient(messageHandler) { BaseAddress = new Uri("http://localhost:5000") };
            var from = new DateTime(2022, 1, 1);
            var to = new DateTime(2022, 1, 2);
            var count = 600;
            var pathAndQuery = $"/api/v1/entries/sgv.json?count={count}&find[dateString][$gte]={from:yyyy-MM-dd}&find[dateString][$lte]={to:yyyy-MM-dd}";
            messageHandler.RespondTo(HttpMethod.Get, pathAndQuery)
                .With(HttpStatusCode.OK)
                .AndContent("application/json", _sgvForDate);

            var glucoseEntries = GlucoseEntry.FromJson(
                new NightscoutApi(httpClient)
                    .GetGlucose(from, to, count).Result);
            
            glucoseEntries.Length.Should().Be(306);
        }

